import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {
    return (<ul>
        <li>Learn react</li>
        <li>Learn docker</li>
        <li>Learn AWS</li>
    </ul>);
};

const element = (
    <div>
        <h1>My todo list</h1>
    <input placeholder="search"/>
    <TodoList/>
    </div>
);
ReactDOM.render(element, document.getElementById('root'));
